export const Nota = ({ nota }) => {
  return (
    <article>
      <p>{nota.text}</p>
      {nota.image ? (
        <img
          src={`${process.env.REACT_APP_BACK}/uploads/${nota.image}`}
          alt={nota.text}
        />
      ) : null}
      <p>
        By {nota.email}
        on {new Date(nota.creted_at).toLocaleString()}
      </p>
    </article>
  );
};
